import React, { Component } from 'react'

export class ConditionalRenderingClass extends Component {
    constructor(props) {
        super(props)

        this.state = {
             isLoaded: true,
             isLoggedIn: true,
        }
    }

    render() {
        return (
            <div>
                <h1>{this.state.isLoaded ? "Data loaded!" : "Loading..."}</h1>
            </div>
        )
    }
}

export default ConditionalRenderingClass
